script: |
  super -f text -I q1601.spq | sort > q1601.out

inputs:
  - name: q1601.spq
    data: |
      SELECT col0 * + - 30 + col0 * + col0 + + col1 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE ( NOT NULL NOT BETWEEN - - col2 / + col1 AND + col2 * - col2 );
  - name: tab2

outputs:
  - name: q1601.out
    data: |
